import TextField from "@material-ui/core/TextField";

function Home() {
    return (
      <div>
        <div>
                <TextField
                        name="username"
                        label="username"
                        id="outlined-basic"
                        variant='outlined'
                        margin="normal"
                        onChange={e => this.updateLoginForm(e.target)}
                    />
            </div>

            <div>
                <TextField
                        name="password"
                        label="Password"
                        type="password"
                        id="outlined-basic"
                        variant='outlined'
                        margin="normal"
                        onChange={e => this.updateLoginForm(e.target)}
                    />
            </div>
      </div>
    );
  }

  export default Home;
